{"insights": ["Manfaatkan kekuatan ekstroversi dan kecerdasan sosial Anda untuk membangun jaringan profesional yang luas sejak dini.", "Prioritaskan pengembangan keterampilan kepemimpinan dan komunikasi persuasif, karena ini adalah aset utama Anda.", "Carilah peluang untuk terlibat dalam proyek atau kegiatan yang memungkinkan Anda berinteraksi dengan berbagai orang dan memimpin inisiatif.", "Pertimbangkan untuk mengambil peran yang menantang dan membutuhkan keberanian, karena Anda memiliki kapasitas tinggi untuk menghadapi risiko.", "Fokus pada pengembangan kemampuan analisis dan perhatian terhadap detail untuk menyeimbangkan kecenderungan Anda pada gambaran besar."], "archetype": "The Charismatic Influencer", "roleModel": [{"name": "Oprah Winfrey", "title": "Media Executive, Talk Show Host, Philanthropist"}, {"name": "Richard Branson", "title": "Founder of Virgin Group"}, {"name": "Sheryl Sandberg", "title": "Former COO of Facebook, Author"}], "strengths": ["Anda memiliki kecerdasan sosial yang luar biasa, memungkinkan Anda memahami dinamika interpersonal dan berinteraksi secara efektif dengan berbagai individu.", "Keberanian Anda yang tinggi mendorong Anda untuk mengambil risiko dan menghadapi tantangan tanpa rasa takut.", "Anda adalah individu yang sangat optimis dan penuh harapan, selalu melihat sisi positif dan potensi di masa depan.", "Kemampuan kepemimpinan Anda alami, mampu menginspirasi dan memotivasi orang lain untuk mencapai tujuan bersama.", "Anda menjunjung tinggi kejujuran dan keadilan, bertindak dengan integritas dalam setiap situasi.", "Kecintaan Anda pada pembelajaran mendorong Anda untuk terus mencari pengetahuan dan mengembangkan diri."], "weaknesses": ["Anda mungkin merasa kurang nyaman dengan tugas-tugas yang sangat rutin, terstruktur, dan minim interaksi sosial.", "Anda perlu mengembangkan kemampuan untuk berkolaborasi dalam tim secara lebih mendalam dan efektif.", "Anda mungkin cenderung mengabaikan detail kecil karena fokus pada gambaran besar dan interaksi sosial.", "Terkadang, optimisme Anda yang tinggi dapat membuat Anda meremehkan potensi tantangan atau kesulitan yang ada.", "Anda mungkin perlu melatih kemampuan untuk memaafkan dan melepaskan kekecewaan, baik terhadap diri sendiri maupun orang lain.", "Anda mungkin kurang menunjukkan afeksi atau kehangatan emosional yang mendalam dalam hubungan personal."], "shortSummary": "Anda adalah individu yang sangat ekstrovert dan berorientasi pada orang, dengan dorongan kuat untuk berinteraksi, mempengaruhi, dan memimpin. Anda memiliki kecerdasan sosial yang tinggi, keberanian, dan optimisme yang menonjol, menjadikan Anda pribadi yang inspiratif dan mampu membangun hubungan dengan mudah. Minat Anda cenderung pada bidang-bidang yang dinamis dan membutuhkan kemampuan komunikasi serta persuasi.

Keterbukaan Anda terhadap pengalaman baru dan kecintaan pada pembelajaran menunjukkan bahwa Anda adalah individu yang adaptif dan selalu mencari cara untuk berkembang. Anda tidak takut mengambil risiko dan memiliki pandangan positif terhadap masa depan, yang sangat mendukung dalam menghadapi tantangan.", "learningStyle": "Anda dapat belajar paling efektif melalui interaksi sosial, diskusi kelompok, dan pengalaman langsung yang memungkinkan Anda untuk mencoba dan mempraktikkan apa yang dipelajari.", "riskTolerance": "high", "coreMotivators": ["Mempengaruhi dan memimpin orang lain", "Berinteraksi sosial secara ekstensif", "Mengekspresikan ide-ide kreatif", "Pembelajaran dan pengembangan diri berkelanjutan"], "skillSuggestion": ["Public Speaking dan Presentasi", "Negosiasi dan Persuasi", "Manajemen Proyek", "Pemasaran Digital", "Keterampilan Fasilitasi dan Moderasi", "Analisis Data Dasar"], "strengthSummary": "Kekuatan utama Anda terletak pada kemampuan interpersonal dan kepemimpinan. Anda memiliki kecerdasan sosial yang luar biasa, memungkinkan Anda memahami dan berinteraksi dengan orang lain secara efektif, serta memimpin dengan empati dan inspirasi. Keberanian dan optimisme Anda yang tinggi membuat Anda tidak gentar menghadapi tantangan dan selalu melihat peluang di setiap situasi.

Selain itu, integritas Anda tercermin dari kejujuran dan keadilan yang Anda junjung tinggi, didukung oleh kerendahan hati dan kebijaksanaan dalam mengambil keputusan. Kecintaan Anda pada pembelajaran mendorong Anda untuk terus mengembangkan diri, sementara selera humor yang baik membantu Anda membangun suasana positif dan meredakan ketegangan.", "weaknessSummary": "Meskipun memiliki banyak kekuatan, Anda perlu memperhatikan beberapa area pengembangan. Skor Anda yang relatif rendah dalam Conventional menunjukkan potensi kesulitan dalam beradaptasi dengan lingkungan yang sangat terstruktur atau pekerjaan yang repetitif dan minim interaksi. Selain itu, Anda mungkin perlu mengembangkan kemampuan dalam kolaborasi tim yang mendalam dan resolusi konflik pribadi, serta memastikan bahwa optimisme Anda tidak mengarah pada pengabaian detail penting.", "workEnvironment": "Lingkungan kerja ideal bagi Anda adalah dinamis, kolaboratif, dan berpusat pada interaksi manusia. Anda akan berkembang di tempat yang menawarkan peluang untuk memimpin, mempengaruhi, dan mengekspresikan ide-ide kreatif. Fleksibilitas dalam tugas dan minimnya struktur yang kaku akan sangat mendukung produktivitas Anda, memungkinkan Anda untuk terus belajar dan berinovasi.", "possiblePitfalls": ["Terjebak dalam pekerjaan yang terlalu rutin atau minim interaksi sosial, yang dapat menyebabkan demotivasi dan kebosanan.", "Mengabaikan detail penting dalam proyek atau tugas karena terlalu fokus pada interaksi dan gambaran besar.", "Mengambil terlalu banyak tanggung jawab sosial atau kepemimpinan tanpa delegasi yang efektif, berpotensi menyebabkan kelelahan.", "Kesulitan dalam beradaptasi dengan lingkungan kerja yang sangat hierarkis atau birokratis yang membatasi inisiatif pribadi.", "Terlalu optimis dan kurang realistis dalam menilai tantangan, yang dapat menghambat perencanaan strategis yang matang."], "careerRecommendation": [{"careerName": "Manajer Pemasaran dan Penjualan", "justification": "Karier ini sangat cocok dengan skor Enterprising dan Social Anda yang tinggi, didukung oleh Extraversion, Social Intelligence, Leadership, dan Humor. Anda akan unggul dalam membangun hubungan, mempengaruhi keputusan, dan memimpin tim untuk mencapai target penjualan atau kampanye pemasaran.", "relatedMajors": ["Manajemen Pemasaran", "Ilmu Komunikasi", "Bisnis dan Kewirausahaan", "Psikologi Industri dan Organisasi"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "high", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "super high"}}, {"careerName": "Konsultan Pendidikan/Pelatihan", "justification": "Dengan minat tinggi pada Pendidikan dan Sosial, serta kekuatan Love of Learning, Social Intelligence, dan Leadership, Anda akan sangat efektif dalam mendidik, melatih, dan membimbing individu atau kelompok. Peran ini memungkinkan Anda untuk terus belajar dan berbagi pengetahuan.", "relatedMajors": ["Pendidikan", "Psikologi", "Manajemen Sumber Daya Manusia", "Ilmu Komunikasi"], "careerProspect": {"aiOvertake": "moderate", "industryGrowth": "high", "jobAvailability": "moderate", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "Spesialis Hubungan Masyarakat (Public Relations)", "justification": "Kombinasi skor Social, Enterprising, dan Artistic, ditambah Extraversion, Social Intelligence, dan Openness, menjadikan Anda ideal untuk membangun dan menjaga citra positif organisasi. Anda akan menggunakan kemampuan komunikasi, persuasi, dan kreativitas untuk mengelola persepsi publik.", "relatedMajors": ["Ilmu Komunikasi", "Hubungan Masyarakat", "Jurnalistik", "Manajemen Media"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "high", "salaryPotential": "moderate", "skillDevelopment": "high", "careerProgression": "high"}}, {"careerName": "Manajer Acara (Event Manager)", "justification": "Minat tinggi pada Pariwisata dan Properti, serta skor Enterprising, Social, dan Artistic, didukung oleh Zest, Perseverance, dan Social Intelligence, sangat cocok untuk mengorganisir acara. Anda akan menikmati dinamika pekerjaan, interaksi dengan banyak pihak, dan melihat hasil nyata dari kreativitas Anda.", "relatedMajors": ["Manajemen Pariwisata", "Manajemen Perhotelan", "Manajemen Acara", "Bisnis dan Kewirausahaan"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "moderate", "jobAvailability": "moderate", "salaryPotential": "moderate", "skillDevelopment": "high", "careerProgression": "moderate"}}], "developmentActivities": {"extracurricular": ["Debat atau Public Speaking Club", "Organisasi Siswa Intra Sekolah (OSIS)", "Klub Kewirausahaan atau Bisnis", "Relawan Komunitas atau Sosial"], "bookRecommendations": [{"title": "How to Win Friends and Influence People", "author": "Dale Carnegie", "reason": "Buku ini akan memperkuat kecerdasan sosial dan kemampuan Anda dalam membangun hubungan serta mempengaruhi orang lain secara positif."}, {"title": "Start With Why", "author": "Simon Sinek", "reason": "Membantu Anda memahami pentingnya tujuan dan inspirasi dalam kepemimpinan, sejalan dengan kekuatan Leadership dan Hope Anda."}, {"title": "The 7 Habits of Highly Effective People", "author": "Stephen Covey", "reason": "Memberikan kerangka kerja untuk pengembangan diri dan efektivitas pribadi, khususnya dalam aspek proaktif dan sinergi tim."}, {"title": "Thinking, Fast and Slow", "author": "Daniel Kahneman", "reason": "Meskipun Anda berorientasi pada interaksi, buku ini akan membantu Anda memahami proses pengambilan keputusan dan bias kognitif, melengkapi kekuatan Judgment Anda."}, {"title": "Originals: How Non-Conformists Move the World", "author": "Adam Grant", "reason": "Mendorong Anda untuk merangkul kreativitas dan keberanian dalam menantang status quo, sejalan dengan Openness dan Bravery Anda."}, {"title": "The Charisma Myth: How Anyone Can Master the Art and Science of Personal Magnetism", "author": "Olivia Fox Cabane", "reason": "Buku ini akan memberikan strategi praktis untuk lebih mengasah karisma alami Anda dan menggunakannya secara efektif dalam berbagai situasi."}]}}

{"insights": ["Prioritaskan pengembangan keterampilan regulasi diri dan manajemen waktu untuk mengatasi kecenderungan kurang terorganisir dan penundaan.", "Latih strategi pengelolaan stres dan emosi untuk mengurangi dampak Neuroticism yang tinggi pada stabilitas Anda.", "Secara aktif cari peluang untuk meningkatkan kecerdasan sosial Anda, seperti mengamati dinamika kelompok atau meminta umpan balik tentang interaksi Anda.", "Manfaatkan kekuatan Anda dalam keingintahuan dan cinta belajar untuk secara konsisten mencari metode baru dalam meningkatkan konsistensi dan ketelitian.", "Pertimbangkan untuk bekerja dalam proyek-proyek kecil yang membutuhkan kolaborasi untuk secara bertahap membangun keterampilan kerja tim Anda."], "archetype": "The Empathetic & Spontaneous Innovator", "roleModel": [{"name": "Adam Grant", "title": "Organizational Psychologist, Author"}, {"name": "Elon Musk", "title": "CEO of Tesla and SpaceX"}, {"name": "Oprah Winfrey", "title": "Media Executive, Talk Show Host, Philanthropist"}], "strengths": ["Anda memiliki rasa ingin tahu yang tinggi dan dorongan kuat untuk mengeksplorasi ide-ide serta konsep baru.", "Anda menunjukkan optimisme yang kuat dan kemampuan untuk mempertahankan harapan bahkan dalam situasi sulit.", "Anda memiliki selera humor yang tinggi dan mampu menggunakan tawa untuk meringankan suasana serta membangun koneksi.", "Anda adalah individu yang berani dan jujur, tidak takut untuk membela apa yang Anda yakini benar.", "Anda memiliki kapasitas besar untuk mencintai dan membentuk ikatan emosional yang kuat dengan orang lain.", "Anda terbuka terhadap pengalaman baru dan memiliki imajinasi yang kaya, memungkinkan Anda melihat berbagai kemungkinan."], "weaknesses": ["Anda cenderung kurang terorganisir dan mungkin kesulitan dalam perencanaan serta pelaksanaan tugas secara sistematis.", "Anda rentan terhadap fluktuasi emosi dan kecemasan, yang dapat memengaruhi pengambilan keputusan dan konsistensi kinerja.", "Anda memiliki tantangan dalam regulasi diri, yang dapat menyebabkan penundaan atau kesulitan dalam mengelola impuls.", "Anda menunjukkan skor rendah dalam kecerdasan sosial, yang mungkin berarti Anda terkadang kesulitan membaca atau merespons dinamika interpersonal yang kompleks.", "Anda mungkin menghadapi kesulitan dalam bekerja sama secara efektif dalam tim, terutama dalam peran yang membutuhkan koordinasi yang ketat.", "Anda cenderung kurang teliti terhadap detail, yang dapat menyebabkan kesalahan atau kelalaian dalam pekerjaan yang membutuhkan presisi."], "shortSummary": "Anda adalah individu yang sangat ingin tahu dan bersemangat, didorong oleh keinginan untuk mengeksplorasi ide-ide baru dan mengekspresikan diri secara kreatif. Dengan sifat ekstrovert dan mudah bergaul, Anda cenderung membangun hubungan yang kuat dan memiliki empati yang tinggi terhadap orang lain. Optimisme dan selera humor Anda menjadi aset dalam menghadapi tantangan.

Namun, Anda juga menunjukkan kecenderungan untuk kurang terstruktur dan mungkin mengalami fluktuasi emosi yang signifikan. Meskipun memiliki minat yang luas dalam berbagai bidang, Anda perlu mengembangkan disiplin diri dan strategi regulasi emosi untuk memaksimalkan potensi Anda.", "learningStyle": "Visual & Kinesthetic, Anda dapat mendapatkan pengalaman belajar paling baik dengan melihat contoh dan langsung mencoba", "riskTolerance": "moderate", "coreMotivators": ["Mengeksplorasi ide-ide baru dan memecahkan masalah", "Menciptakan dan mengekspresikan diri secara orisinal", "Membangun koneksi sosial yang bermakna dan memberikan dampak positif", "Terus belajar dan mengembangkan pemahaman"], "skillSuggestion": ["Manajemen Waktu dan Prioritas", "Regulasi Emosi dan Ketahanan Mental", "Komunikasi Interpersonal Efektif", "Berpikir Kritis dan Analitis", "Keterampilan Kolaborasi dan Kerja Tim", "Kreativitas Terstruktur"], "strengthSummary": "Kekuatan utama Anda terletak pada kapasitas untuk berinteraksi secara positif dengan lingkungan sosial dan kemampuan untuk berpikir secara orisinal. Anda memiliki semangat yang tinggi untuk belajar dan menjelajahi hal-hal baru, didukung oleh keberanian untuk menghadapi tantangan dan kejujuran dalam berinteraksi. Kemampuan Anda untuk melihat sisi positif dan menggunakan humor juga menjadi sumber daya yang berharga.

Anda adalah individu yang penuh kasih sayang dan peduli, yang secara alami menarik orang lain. Keingintahuan intelektual Anda mendorong Anda untuk terus mencari pengetahuan dan pemahaman, memungkinkan Anda untuk beradaptasi dengan berbagai situasi dan menemukan solusi inovatif.", "weaknessSummary": "Area pengembangan utama Anda berpusat pada konsistensi dan regulasi emosi. Anda cenderung kurang terorganisir dan mungkin kesulitan dalam mempertahankan fokus pada tugas-tugas jangka panjang, yang dapat menghambat penyelesaian proyek. Selain itu, Anda rentan terhadap perubahan suasana hati dan kecemasan, yang dapat memengaruhi stabilitas emosional Anda.", "workEnvironment": "Anda akan berkembang paling baik dalam lingkungan kerja yang dinamis, kolaboratif, dan memberikan ruang untuk eksplorasi ide-ide baru serta ekspresi kreatif. Lingkungan yang mendukung otonomi, menghargai inovasi, dan memiliki budaya komunikasi terbuka akan sangat cocok. Penting juga adanya dukungan untuk pengembangan diri dan fleksibilitas dalam pendekatan tugas, meskipun dengan ekspektasi yang jelas.", "possiblePitfalls": ["Kecenderungan untuk memulai banyak proyek tanpa menyelesaikannya karena kurangnya ketelitian dan regulasi diri.", "Kesulitan dalam menghadapi lingkungan kerja yang sangat terstruktur atau monoton, yang dapat memicu kebosanan dan penurunan motivasi.", "Potensi untuk terlalu mengandalkan pesona sosial tanpa mengembangkan kedalaman dalam pemecahan masalah atau tanggung jawab.", "Mengalami kelelahan emosional akibat fluktuasi suasana hati yang tidak terkelola dengan baik.", "Kesulitan dalam menerima kritik konstruktif atau beradaptasi dengan aturan yang kaku."], "careerRecommendation": [{"careerName": "Content Creator/Digital Storyteller", "justification": "Minat Artistic yang tinggi, Openness, Extraversion, Humor, dan Love menunjukkan kemampuan untuk menciptakan konten yang menarik dan terhubung dengan audiens. Minat pada industri Media dan Kreatif sangat mendukung.", "relatedMajors": ["Ilmu Komunikasi", "Desain Komunikasi Visual", "Jurnalistik", "Sastra"], "careerProspect": {"aiOvertake": "moderate", "industryGrowth": "super high", "jobAvailability": "high", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "UX/UI Designer", "justification": "Kombinasi minat Artistic dan Investigative yang tinggi, didukung oleh Openness dan Curiosity, sangat cocok untuk merancang pengalaman pengguna yang intuitif dan estetis. Minat pada Teknologi dan Kreatif juga relevan.", "relatedMajors": ["Desain Komunikasi Visual", "Desain Produk", "Ilmu Komputer", "Psikologi Kognitif"], "careerProspect": {"aiOvertake": "moderate", "industryGrowth": "super high", "jobAvailability": "high", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "Peneliti Sosial/Pendidikan", "justification": "Minat Investigative dan Social yang tinggi, didukung oleh Curiosity, Love of Learning, Agreeableness, dan Hope, menunjukkan potensi dalam memahami fenomena sosial atau pendidikan. Minat pada Sains, Sosial, dan Pendidikan sangat relevan.", "relatedMajors": ["Sosiologi", "Antropologi", "Ilmu Pendidikan", "Psikologi", "Ilmu Politik"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "moderate", "salaryPotential": "moderate", "skillDevelopment": "high", "careerProgression": "moderate"}}, {"careerName": "Pendidik/Fasilitator", "justification": "Minat Social dan Artistic, didukung oleh Extraversion, Agreeableness, Love, Hope, dan Humor, sangat cocok untuk mengajar atau memfasilitasi pembelajaran dengan cara yang menarik dan empatik. Minat pada Pendidikan dan Sosial sangat kuat.", "relatedMajors": ["Ilmu Pendidikan", "Psikologi", "Sastra", "Komunikasi"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "moderate", "jobAvailability": "high", "salaryPotential": "moderate", "skillDevelopment": "high", "careerProgression": "high"}}], "developmentActivities": {"extracurricular": ["Klub Debat atau Diskusi Ilmiah", "Klub Jurnalistik atau Majalah Dinding Sekolah", "Kelompok Teater atau Seni Pertunjukan", "Organisasi Sosial atau Relawan"], "bookRecommendations": [{"title": "Atomic Habits", "author": "James Clear", "reason": "Membantu Anda membangun kebiasaan positif dan sistematis untuk mengatasi tantangan regulasi diri dan konsistensi."}, {"title": "Emotional Intelligence 2.0", "author": "Travis Bradberry & Jean Greaves", "reason": "Memberikan strategi praktis untuk memahami dan mengelola emosi Anda, serta meningkatkan kecerdasan sosial."}, {"title": "The Artist's Way", "author": "Julia Cameron", "reason": "Panduan untuk membuka dan memelihara kreativitas Anda, yang selaras dengan minat Artistic Anda."}, {"title": "Thinking, Fast and Slow", "author": "Daniel Kahneman", "reason": "Mengembangkan pemahaman tentang proses berpikir dan pengambilan keputusan, mendukung sisi Investigative Anda."}, {"title": "Dare to Lead", "author": "Brené Brown", "reason": "Membantu Anda memahami pentingnya keberanian dan kerentanan dalam kepemimpinan dan hubungan, selaras dengan nilai kejujuran dan keberanian Anda."}, {"title": "The 7 Habits of Highly Effective People", "author": "Stephen Covey", "reason": "Memberikan kerangka kerja untuk efektivitas pribadi dan interpersonal, sangat relevan untuk meningkatkan Conscientiousness dan Self-Regulation Anda."}]}}

{"insights": ["Latih kemampuan asertivitas Anda dengan menetapkan batasan yang jelas dan belajar mengatakan 'tidak' secara konstruktif untuk melindungi waktu dan energi Anda.", "Kembangkan strategi untuk mengelola perfeksionisme, fokus pada kemajuan daripada kesempurnaan mutlak, dan belajar menerima bahwa kesalahan adalah bagian dari proses belajar.", "Beranikan diri untuk menghadapi konflik secara langsung dan konstruktif, melihatnya sebagai peluang untuk pertumbuhan dan pemahaman, bukan sebagai ancaman terhadap harmoni.", "Manfaatkan kekuatan kepemimpinan dan sosial Anda untuk menjadi mentor atau fasilitator dalam kelompok, memperkuat kemampuan Anda dalam membimbing dan menginspirasi orang lain.", "Secara aktif mencari umpan balik dari berbagai sumber untuk mendapatkan perspektif baru dan mengidentifikasi area pengembangan yang mungkin terlewatkan."], "archetype": "The Principled Social Architect", "roleModel": [{"name": "Nelson Mandela", "title": "Former President of South Africa, Anti-Apartheid Revolutionary"}, {"name": "Oprah Winfrey", "title": "Media Executive, Talk Show Host, Philanthropist"}, {"name": "Malala Yousafzai", "title": "Activist for Female Education, Nobel Laureate"}], "strengths": ["Kemampuan memimpin dan menginspirasi tim dengan visi yang jelas dan etika yang kuat.", "Empati dan kepedulian tinggi terhadap kesejahteraan orang lain, mendorong Anda untuk bertindak adil dan baik.", "Integritas dan kejujuran yang tak tergoyahkan dalam setiap interaksi dan keputusan.", "Ketekunan luar biasa dalam mencapai tujuan, tidak mudah menyerah di hadapan rintangan.", "Keterampilan sosial yang tinggi, memungkinkan Anda membangun hubungan harmonis dan efektif.", "Kemampuan pengambilan keputusan yang bijaksana, didukung oleh perspektif yang luas dan penilaian yang matang."], "weaknesses": ["Kecenderungan untuk terlalu akomodatif dan sulit menolak permintaan, berpotensi menyebabkan kelelahan.", "Potensi untuk menjadi terlalu kritis terhadap diri sendiri karena standar tinggi yang ditetapkan.", "Kesulitan dalam menghadapi konflik langsung yang dapat mengganggu harmoni, cenderung menghindarinya.", "Mungkin kurang fleksibel terhadap perubahan rencana mendadak atau situasi yang tidak terduga.", "Cenderung memikul terlalu banyak tanggung jawab, sulit mendelegasikan tugas kepada orang lain.", "Risiko kelelahan emosional akibat terlalu banyak berinvestasi pada masalah orang lain."], "shortSummary": "Anda adalah individu yang sangat berorientasi pada sosial, didorong oleh keinginan kuat untuk berinteraksi, membantu, dan memimpin orang lain. Dengan tingkat Agreeableness dan Conscientiousness yang sangat tinggi, Anda menunjukkan empati yang mendalam, tanggung jawab yang luar biasa, serta kemampuan untuk bekerja secara sistematis dan terorganisir. Anda memiliki stabilitas emosional yang baik, memungkinkan Anda menghadapi tantangan dengan tenang dan resilien.

Kombinasi minat Social, Enterprising, dan Investigative menunjukkan bahwa Anda tidak hanya ingin berinteraksi dan memimpin, tetapi juga memiliki dorongan untuk memahami, menganalisis, dan memecahkan masalah yang kompleks. Anda adalah pribadi yang berintegritas tinggi, gigih, dan memiliki semangat hidup yang menular, menjadikan Anda aset berharga dalam setiap tim atau komunitas.", "learningStyle": "Anda belajar paling efektif melalui struktur yang jelas, studi kasus, dan proyek kolaboratif yang memungkinkan Anda menerapkan teori secara langsung. Pendekatan praktis dan diskusi kelompok akan sangat mendukung pemahaman Anda.", "riskTolerance": "moderate", "coreMotivators": ["Membantu dan melayani sesama", "Menciptakan dan memelihara keharmonisan sosial", "Memimpin inisiatif dengan integritas", "Mencapai tujuan melalui kolaborasi terstruktur"], "skillSuggestion": ["Keterampilan Negosiasi dan Mediasi", "Manajemen Proyek dan Delegasi Efektif", "Komunikasi Persuasif dan Public Speaking", "Pengambilan Keputusan Berbasis Data", "Manajemen Stres dan Resiliensi", "Keterampilan Mentoring dan Coaching"], "strengthSummary": "Kekuatan utama Anda terletak pada kemampuan interpersonal dan etos kerja yang luar biasa. Anda secara alami mampu memimpin dan menginspirasi orang lain, didukung oleh empati yang mendalam dan keinginan tulus untuk kebaikan bersama. Integritas dan kejujuran adalah pilar karakter Anda, memastikan bahwa setiap tindakan Anda didasari oleh prinsip moral yang kuat.

Selain itu, Anda memiliki ketekunan yang tak tergoyahkan dalam mencapai tujuan, dikombinasikan dengan kemampuan pengambilan keputusan yang bijaksana dan perspektif yang luas. Anda adalah individu yang bertanggung jawab, terorganisir, dan mampu membangun serta memelihara hubungan yang harmonis, menjadikan Anda seorang kolaborator dan pemimpin yang sangat efektif.", "weaknessSummary": "Meskipun memiliki banyak kekuatan, Anda perlu menyadari beberapa area pengembangan. Kecenderungan Anda untuk menjadi sangat akomodatif dan menjaga harmoni dapat membuat Anda kesulitan menolak permintaan atau menghadapi konflik secara langsung. Standar tinggi yang Anda miliki, meskipun mendorong ketekunan, juga berpotensi menyebabkan perfeksionisme atau kritik diri yang berlebihan. Fleksibilitas terhadap perubahan mendadak mungkin menjadi tantangan, mengingat preferensi Anda terhadap struktur dan keteraturan.", "workEnvironment": "Lingkungan kerja ideal bagi Anda adalah yang kolaboratif, terstruktur, dan berorientasi pada tujuan, di mana Anda dapat berinteraksi secara intens dengan orang lain. Anda akan berkembang dalam peran yang memungkinkan Anda memimpin, membimbing, dan memberikan dampak positif pada kehidupan orang lain atau komunitas. Penting bagi Anda untuk berada di lingkungan yang menjunjung tinggi etika, keadilan, dan memberikan kesempatan untuk pengembangan diri serta penerapan nilai-nilai Anda.", "possiblePitfalls": ["Terlalu banyak memikul tanggung jawab karena kesulitan mendelegasikan, berujung pada kelelahan (burnout).", "Menghindari konfrontasi yang diperlukan demi menjaga harmoni, yang dapat menghambat penyelesaian masalah jangka panjang.", "Terjebak dalam rutinitas dan kurang berani mengambil risiko yang terukur, membatasi peluang inovasi.", "Perfeksionisme yang berlebihan dapat menyebabkan penundaan atau kesulitan dalam menyelesaikan tugas.", "Mengabaikan kebutuhan pribadi karena terlalu fokus pada kebutuhan dan masalah orang lain."], "careerRecommendation": [{"careerName": "Social Worker", "justification": "Profesi ini sangat selaras dengan skor Social RIASEC Anda yang tinggi, Agreeableness, Kindness, Love, dan Fairness dari VIA-IS. Anda akan dapat secara langsung menerapkan empati dan keinginan Anda untuk membantu individu serta komunitas yang membutuhkan.", "relatedMajors": ["Ilmu Kesejahteraan Sosial", "Psikologi", "Sosiologi", "Pekerjaan Sosial"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "high", "salaryPotential": "moderate", "skillDevelopment": "super high", "careerProgression": "moderate"}}, {"careerName": "Human Resources Manager", "justification": "Kombinasi skor Enterprising dan Social RIASEC, didukung oleh Conscientiousness, Leadership, Social Intelligence, dan Teamwork dari OCEAN dan VIA-IS, menjadikan Anda ideal untuk mengelola sumber daya manusia. Anda dapat menciptakan lingkungan kerja yang adil dan produktif, serta memimpin inisiatif pengembangan karyawan.", "relatedMajors": ["Manajemen Sumber Daya Manusia", "Psikologi Industri dan Organisasi", "Ilmu Administrasi Bisnis", "Hukum Ketenagakerjaan"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "high", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "Educator/Trainer", "justification": "Dengan skor Social yang tinggi, Love of Learning, Kindness, dan Leadership dari VIA-IS, Anda memiliki kapasitas untuk menginspirasi dan membimbing orang lain. Profesi ini memungkinkan Anda berbagi pengetahuan, membentuk karakter, dan memfasilitasi pertumbuhan individu, sejalan dengan minat Pendidikan Anda.", "relatedMajors": ["Pendidikan", "Kurikulum dan Teknologi Pendidikan", "Psikologi Pendidikan", "Manajemen Pendidikan"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "moderate", "jobAvailability": "high", "salaryPotential": "moderate", "skillDevelopment": "high", "careerProgression": "moderate"}}, {"careerName": "Legal Professional (e.g., Mediator, Public Defender)", "justification": "Minat Anda pada Hukum, dikombinasikan dengan skor Investigative dan Social RIASEC, serta kekuatan Judgment, Fairness, Honesty, dan Perspective dari VIA-IS, sangat cocok untuk profesi hukum yang berfokus pada keadilan dan penyelesaian konflik. Anda dapat menggunakan kemampuan analisis dan empati Anda untuk membela hak orang lain atau memfasilitasi kesepakatan yang adil.", "relatedMajors": ["Ilmu Hukum", "Kriminologi", "Ilmu Politik", "Sosiologi"], "careerProspect": {"aiOvertake": "moderate", "industryGrowth": "moderate", "jobAvailability": "moderate", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "high"}}], "developmentActivities": {"extracurricular": ["Organisasi Siswa Intra Sekolah (OSIS)", "Klub Debat atau Public Speaking", "Kegiatan Sosial atau Relawan", "Klub Jurnalistik atau Majalah Dinding"], "bookRecommendations": [{"title": "How to Win Friends and Influence People", "author": "Dale Carnegie", "reason": "Buku ini akan memperkuat keterampilan interpersonal dan kepemimpinan Anda, mengajarkan cara membangun hubungan yang efektif dan memengaruhi orang lain secara positif."}, {"title": "The 7 Habits of Highly Effective People", "author": "Stephen Covey", "reason": "Untuk mengasah Conscientiousness dan Self-Regulation Anda, buku ini memberikan kerangka kerja untuk menjadi lebih proaktif, fokus pada prioritas, dan mencapai tujuan dengan integritas."}, {"title": "Dare to Lead", "author": "Brené Brown", "reason": "Membantu Anda mengembangkan kepemimpinan yang berani dan empatik, mengajarkan pentingnya kerentanan dan keberanian dalam memimpin dengan hati."}, {"title": "Crucial Conversations: Tools for Talking When Stakes Are High", "author": "Kerry Patterson, Joseph Grenny, Ron McMillan, Al Switzler", "reason": "Buku ini akan membekali Anda dengan strategi untuk menghadapi konflik dan percakapan sulit secara konstruktif, mengatasi kelemahan Anda dalam menghindari konfrontasi."}, {"title": "Atomic Habits", "author": "James Clear", "reason": "Untuk mendukung Perseverance dan Self-Regulation Anda, buku ini menawarkan metode praktis untuk membangun kebiasaan baik dan mencapai peningkatan berkelanjutan."}, {"title": "Thinking, Fast and Slow", "author": "Daniel Kahneman", "reason": "Meningkatkan kekuatan Judgment dan Perspective Anda dengan memahami cara kerja pikiran, membantu Anda membuat keputusan yang lebih rasional dan terinformasi."}]}}

{"insights": ["Manfaatkan energi dan antusiasme Anda untuk memulai proyek, namun kembangkan sistem untuk menjaga konsistensi dan penyelesaian.", "Latih kemampuan refleksi diri dan penerimaan umpan balik untuk menyeimbangkan kepercayaan diri dengan kerendahan hati.", "Fokus pada pengembangan struktur dan rutinitas untuk meningkatkan Conscientiousness dan Self-Regulation.", "Prioritaskan tugas-tugas penting dan hindari multitasking berlebihan untuk meningkatkan fokus dan ketelitian.", "Cari lingkungan kerja yang memungkinkan Anda berinteraksi sosial dan mengekspresikan kreativitas secara bebas."], "archetype": "The Dynamic Social Innovator", "roleModel": [{"name": "Nadiem Makarim", "title": "Founder Gojek & Former Minister of Education, Culture, Research, and Technology"}, {"name": "Richard Branson", "title": "Founder of Virgin Group"}, {"name": "Oprah Winfrey", "title": "Media Executive, Talk Show Host, and Philanthropist"}], "strengths": ["Kemampuan adaptasi dan eksplorasi ide baru yang tinggi, didukung oleh Openness dan Curiosity.", "Energi dan antusiasme yang luar biasa dalam setiap aktivitas, tercermin dari Zest dan Extraversion.", "Keterampilan interpersonal yang kuat, memungkinkan Anda membangun hubungan dan memimpin tim secara efektif.", "Kreativitas dan apresiasi terhadap keindahan yang mendalam, memungkinkan Anda melihat solusi inovatif dan menciptakan karya orisinal.", "Keberanian untuk mengambil inisiatif dan menghadapi tantangan, didukung oleh Bravery dan Leadership.", "Dorongan kuat untuk belajar dan mengembangkan pengetahuan secara berkelanjutan, ditunjukkan oleh Love of Learning."], "weaknesses": ["Kecenderungan untuk kurang terstruktur atau kurang teliti dalam perencanaan detail, akibat Conscientiousness yang moderat.", "Potensi untuk mengalami fluktuasi emosi atau stres dalam menghadapi tekanan, ditunjukkan oleh Neuroticism yang moderat.", "Kesulitan dalam mempertahankan fokus pada tugas jangka panjang yang monoton atau kurang menantang, karena Perseverance yang moderat.", "Kecenderungan untuk kurang berhati-hati dalam mengambil keputusan, didukung oleh Prudence yang moderat.", "Tantangan dalam mengelola impuls atau menunda kepuasan, tercermin dari Self-Regulation yang moderat.", "Potensi untuk kurang reflektif terhadap diri sendiri atau menerima kritik, didukung oleh Humility yang moderat."], "shortSummary": "Anda adalah individu yang sangat dinamis dan bersemangat, dengan energi sosial yang meluap-luap dan keinginan kuat untuk berinteraksi. Anda memiliki perpaduan unik antara minat praktis, artistik, sosial, dan wirausaha, yang membuat Anda tertarik pada berbagai bidang yang memungkinkan Anda mengekspresikan diri dan berinovasi. Kecenderungan Anda untuk terbuka terhadap pengalaman baru dan rasa ingin tahu yang tinggi mendorong Anda untuk terus belajar dan mengeksplorasi.

Dengan kekuatan karakter seperti semangat hidup (Zest), kasih sayang (Love), apresiasi terhadap keindahan, humor, dan spiritualitas, Anda membawa aura positif ke mana pun Anda pergi. Anda adalah seorang pembelajar sejati dengan kemampuan kepemimpinan dan kerja sama tim yang kuat, selalu siap untuk menghadapi tantangan dengan keberanian dan kejujuran.", "learningStyle": "Experiential & Collaborative, Anda belajar paling efektif melalui interaksi langsung, diskusi, dan mencoba hal-hal baru dalam lingkungan yang dinamis.", "riskTolerance": "high", "coreMotivators": ["Menciptakan dampak positif melalui interaksi sosial dan kepemimpinan.", "Eksplorasi ide-ide baru dan ekspresi kreatif.", "Belajar dan mengembangkan diri secara berkelanjutan.", "Membangun dan memelihara hubungan yang harmonis."], "skillSuggestion": ["Manajemen Proyek dan Organisasi", "Keterampilan Komunikasi Persuasif dan Negosiasi", "Desain Berpikir (Design Thinking) dan Inovasi", "Analisis Data Dasar untuk Pengambilan Keputusan", "Keterampilan Fasilitasi dan Pelatihan", "Pemasaran Digital dan Branding"], "strengthSummary": "Kekuatan utama Anda terletak pada kemampuan untuk menginspirasi dan memimpin orang lain melalui energi dan karisma alami Anda. Anda memiliki kapasitas luar biasa untuk membangun hubungan yang kuat dan harmonis, serta memfasilitasi kolaborasi yang efektif dalam tim. Keberanian Anda untuk mengambil inisiatif dan kejujuran Anda dalam berinteraksi menjadikan Anda sosok yang dapat diandalkan dan dihormati.

Selain itu, Anda memiliki pikiran yang sangat kreatif dan analitis, memungkinkan Anda untuk melihat masalah dari berbagai perspektif dan menemukan solusi inovatif. Dorongan kuat untuk belajar dan rasa ingin tahu yang tak terbatas memastikan bahwa Anda akan terus berkembang dan menguasai bidang-bidang baru dengan cepat.", "weaknessSummary": "Meskipun Anda memiliki banyak kekuatan, terdapat beberapa area yang memerlukan perhatian untuk pengembangan optimal. Anda mungkin menghadapi tantangan dalam hal konsistensi dan ketelitian detail, yang dapat memengaruhi penyelesaian proyek jangka panjang atau tugas yang membutuhkan fokus tinggi. Selain itu, Anda mungkin perlu mengembangkan strategi yang lebih efektif untuk mengelola fluktuasi emosi dan tekanan, serta meningkatkan kehati-hatian dalam pengambilan keputusan.", "workEnvironment": "Lingkungan kerja ideal bagi Anda adalah yang dinamis, kolaboratif, dan merangsang, di mana Anda dapat berinteraksi secara ekstensif dengan orang lain dan mengekspresikan ide-ide kreatif. Anda akan berkembang dalam peran yang menawarkan otonomi, kesempatan untuk memimpin, memecahkan masalah, dan memberikan dampak nyata, serta memungkinkan pembelajaran dan pengembangan berkelanjutan.", "possiblePitfalls": ["Kecenderungan untuk memulai banyak hal tanpa menyelesaikannya secara tuntas, akibat Conscientiousness dan Perseverance yang moderat.", "Mengabaikan detail penting dalam proyek atau tugas karena fokus pada gambaran besar dan ide-ide baru.", "Kesulitan dalam bekerja di lingkungan yang sangat terstruktur, monoton, atau minim interaksi sosial.", "Potensi untuk terlalu impulsif dalam mengambil keputusan tanpa pertimbangan matang, didukung oleh Prudence yang moderat.", "Terlalu mengandalkan karisma dan ide-ide besar tanpa dukungan data atau perencanaan yang solid."], "careerRecommendation": [{"careerName": "Event Organizer/Manajer Proyek Kreatif", "justification": "Minat tinggi pada Artistic, Social, Enterprising, didukung oleh Extraversion, Zest, Teamwork, Leadership, dan Creativity. Anda akan berkembang dalam lingkungan yang dinamis, membutuhkan interaksi sosial, dan memungkinkan ekspresi ide-ide baru.", "relatedMajors": ["Manajemen Acara", "Komunikasi", "Pemasaran", "Desain Komunikasi Visual"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "high", "salaryPotential": "moderate", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "Pendidik/Pelatih Pengembangan Diri", "justification": "Minat kuat pada Social dan Enterprising, didukung oleh Love of Learning, Kindness, Teamwork, Leadership, dan Extraversion. Anda memiliki kemampuan alami untuk menginspirasi, membimbing, dan memfasilitasi pertumbuhan orang lain.", "relatedMajors": ["Pendidikan", "Psikologi", "Komunikasi", "Pengembangan Sumber Daya Manusia"], "careerProspect": {"aiOvertake": "low", "industryGrowth": "high", "jobAvailability": "high", "salaryPotential": "moderate", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "Spesialis Pemasaran Digital/Brand Manager", "justification": "Kombinasi minat Artistic, Enterprising, dan Social, didukung oleh Openness, Extraversion, Creativity, dan Judgment. Anda dapat secara efektif mengkomunikasikan ide-ide, membangun merek, dan menjangkau audiens yang luas.", "relatedMajors": ["Pemasaran", "Komunikasi", "Bisnis", "Desain Komunikasi Visual"], "careerProspect": {"aiOvertake": "moderate", "industryGrowth": "super high", "jobAvailability": "super high", "salaryPotential": "high", "skillDevelopment": "super high", "careerProgression": "high"}}, {"careerName": "Desainer Produk/UX Designer", "justification": "Minat pada Realistic, Artistic, dan Investigative, didukung oleh Openness, Creativity, Curiosity, dan Judgment. Anda memiliki kemampuan untuk menciptakan solusi yang fungsional, estetis, dan berpusat pada pengguna.", "relatedMajors": ["Desain Produk", "Desain Komunikasi Visual", "Ilmu Komputer (dengan fokus UX/UI)", 