{"insights": ["Manfaatkan kekuatan analitis Anda untuk secara proaktif mengidentifikasi area yang membutuhkan pengembangan diri, bukan hanya menunggu masalah muncul.", "Latih kemampuan komunikasi asertif dalam kelompok besar atau saat presentasi untuk memastikan ide-ide Anda didengar dan dipertimbangkan secara efektif.", "Cari mentor atau bergabung dengan komunitas profesional yang mendorong diskusi terbuka dan pertukaran perspektif untuk memperluas pandangan Anda.", "Tetapkan tujuan yang jelas dan terukur untuk meningkatkan konsistensi dalam perencanaan detail dan eksekusi tugas, terutama dalam proyek jangka panjang.", "Beranikan diri untuk mengambil risiko yang terukur setelah melakukan analisis yang cermat, jangan terlalu terpaku pada kehati-hatian yang berlebihan."], "archetype": "The Principled Investigator", "roleModel": [{"name": "B.J. Habibie", "title": "Former President of Indonesia, Engineer"}, {"name": "Marie Curie", "title": "Physicist and Chemist, Nobel Laureate"}, {"name": "Jane Goodall", "title": "Primatologist and Anthropologist"}], "strengths": ["Anda memiliki integritas moral yang tinggi, ditunjukkan oleh kejujuran dan keadilan dalam setiap tindakan.", "Anda sangat termotivasi untuk belajar dan mengembangkan pengetahuan secara berkelanjutan.", "Anda menunjukkan ketekunan yang kuat dalam mencapai tujuan, tidak mudah menyerah di hadapan rintangan.", "Anda mampu mengatur diri dengan baik, menjaga disiplin dan fokus pada tugas.", "Anda memiliki optimisme yang realistis dan pandangan positif terhadap masa depan.", "Anda menunjukkan empati dan kemampuan bekerja sama yang baik dalam tim."], "weaknesses": ["Anda cenderung kurang proaktif dalam interaksi sosial skala besar atau lingkungan yang ramai.", "Anda mungkin kesulitan dalam mengambil inisiatif untuk memimpin dalam situasi yang membutuhkan dominasi sosial.", "Anda mungkin perlu meningkatkan konsistensi dalam perencanaan detail dan ketelitian dalam eksekusi tugas.", "Anda mungkin kurang nyaman dalam s